import React from "react";
import "./Jars.css";


const Jar = (props) => (
    <div className="jar"  onClick={props.onClick}>
        <div className="jar-info">
            <img
                alt={props.id}
                src={props.image}
            />
            <h2>{props.Name}</h2>
            <h2>{'$' + props.Amount}</h2>
        </div>
    </div>
);


export default Jar;
